// RegisterVendor.js
import React, { useState } from 'react';
import axios from 'axios';

const RegisterVendor = () => {
  const [vendorData, setVendorData] = useState({
    name: '',
    posSystem: '',
    apiKey: '',
    apiEndpoint: '',
    dispensaryName: '',
    address: '',
    contactNumber: '',
    password: '',
  });
  const [message, setMessage] = useState('');

  const handleChange = (e) => {
    setVendorData({ ...vendorData, [e.target.name]: e.target.value });
  };

  const handleRegister = async (e) => {
    e.preventDefault();
    try {
      const response = await axios.post('http://localhost:4000/api/auth/register', vendorData);
      setMessage(response.data.message);
    } catch (error) {
      setMessage(error.response ? error.response.data.message : "Registration failed");
      console.error('Error during registration:', error);
    }
  };

  return (
    <div className="container mt-5">
      <h2>Register Vendor</h2>
      <form onSubmit={handleRegister}>
        <div className="mb-3">
          <label className="form-label">Vendor Name</label>
          <input
            type="text"
            className="form-control"
            name="name"
            value={vendorData.name}
            onChange={handleChange}
            required
          />
        </div>
        <div className="mb-3">
          <label className="form-label">POS System</label>
          <select
            className="form-select"
            name="posSystem"
            value={vendorData.posSystem}
            onChange={handleChange}
            required
          >
            <option value="">Select POS System</option>
            <option value="treez">Treez</option>
            <option value="flowhub">Flowhub</option>
            {/* Add other POS options as needed */}
          </select>
        </div>
        <div className="mb-3">
          <label className="form-label">API Key</label>
          <input
            type="text"
            className="form-control"
            name="apiKey"
            value={vendorData.apiKey}
            onChange={handleChange}
            required
          />
        </div>
        <div className="mb-3">
          <label className="form-label">API Endpoint</label>
          <input
            type="text"
            className="form-control"
            name="apiEndpoint"
            value={vendorData.apiEndpoint}
            onChange={handleChange}
            required
          />
        </div>
        <div className="mb-3">
          <label className="form-label">Dispensary Name</label>
          <input
            type="text"
            className="form-control"
            name="dispensaryName"
            value={vendorData.dispensaryName}
            onChange={handleChange}
          />
        </div>
        <div className="mb-3">
          <label className="form-label">Address</label>
          <input
            type="text"
            className="form-control"
            name="address"
            value={vendorData.address}
            onChange={handleChange}
          />
        </div>
        <div className="mb-3">
          <label className="form-label">Contact Number</label>
          <input
            type="text"
            className="form-control"
            name="contactNumber"
            value={vendorData.contactNumber}
            onChange={handleChange}
          />
        </div>
        <div className="mb-3">
          <label className="form-label">Password</label>
          <input
            type="password"
            className="form-control"
            name="password"
            value={vendorData.password}
            onChange={handleChange}
            required
          />
        </div>
        <button type="submit" className="btn btn-primary">Register</button>
      </form>
      {message && <div className="alert mt-3">{message}</div>}
    </div>
  );
};

export default RegisterVendor;
